The Maven build failed due to a dependency convergence error. The error message indicates that there is a conflict between two different versions of the commons-io library.

Let me try to fix the issue by adding a dependency management section to the pom.xml file to ensure that the same version of commons-io is used throughout the project.

<function=str_replace_editor>
<parameter=command>str_replace</parameter>
<parameter=path>/workspace/jannovar/pom.xml</parameter>
<parameter=old_str>&lt;/dependencies&gt;</parameter>
<parameter=new_str>
&lt;/dependencies&gt;
  &lt;dependencyManagement&gt;
    &lt;dependencies&gt;
      &lt;dependency&gt;
        &lt;groupId&gt;commons-io&lt;/groupId&gt;
        &lt;artifactId&gt;commons-io&lt;/artifactId&gt;
        &lt;version&gt;2.19.0&lt;/version&gt;
      &lt;/dependency&gt;
    &lt;/dependencies&gt;
  &lt;/dependencyManagement&gt;
</parameter>
</function>

